import React from 'react'
import { Parallax, Background } from 'react-parallax';



export const Home = () => (
    <div>
        <Parallax
            bgImage={require('./assets/landing.jpg')} strength={500}
        >
            <div style={{ width: '100%', height:'110vh'}}>
                <div>HTML INSIDE</div>
            </div>
        </Parallax>
    </div>

)
